import React from 'react';

const Sidebar = () => {
  return (
    <aside className="bg-gray-200 p-4">
      <nav>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>
    </aside>
  );
};

export default Sidebar;
